from dataclasses import dataclass
from typing import TypeVar, Generic, Callable

T = TypeVar('T')
U = TypeVar('U')

@dataclass
class Ok(Generic[T]):
    value: T

@dataclass
class Err:
    message: str

Result = Ok[T] | Err

def parse_int(s: str) -> Result[int]:
    try:
        return Ok(int(s))
    except ValueError:
        return Err("Invalid integer")

def divide_safe(a: int, b: int) -> Result[int]:
    if b == 0:
        return Err("Division by zero")
    return Ok(a // b)

def bind(result: Result[T], func: Callable[[T], Result[U]]) -> Result[U]:
    if isinstance(result, Ok):
        return func(result.value)
    return result

def print_result(result: Result):
    if isinstance(result, Ok):
        print(f"Result: {result.value}")
    else:
        print(f"Error: {result.message}")

# Test case 1
result1 = parse_int("10")
result1 = bind(result1, lambda x: divide_safe(x, 2))
print_result(result1)

# Test case 2
result2 = parse_int("10")
result2 = bind(result2, lambda x: divide_safe(x, 0))
print_result(result2)

# Test case 3
result3 = parse_int("abc")
print_result(result3)

