import std/io (println)

type List[a] = Cons(a, List[a]) | Nil

export func fromRange(start: int, end: int) -> List[int] {
  if start > end
  then Nil
  else Cons(start, fromRange(start + 1, end))
}

export func mapList[a, b](f: func(a) -> b, xs: List[a]) -> List[b] {
  match xs {
    Nil => Nil,
    Cons(h, t) => Cons(f(h), mapList(f, t))
  }
}

export func filterList[a](p: func(a) -> bool, xs: List[a]) -> List[a] {
  match xs {
    Nil => Nil,
    Cons(h, t) => if p(h) then Cons(h, filterList(p, t)) else filterList(p, t)
  }
}

export func foldList[a, b](f: func(b, a) -> b, acc: b, xs: List[a]) -> b {
  match xs {
    Nil => acc,
    Cons(h, t) => foldList(f, f(acc, h), t)
  }
}

export func showIntList(xs: List[int]) -> string {
  "[" ++ showIntListContents(xs) ++ "]"
}

export func showIntListContents(xs: List[int]) -> string {
  match xs {
    Nil => "",
    Cons(h, Nil) => show(h),
    Cons(h, t) => show(h) ++ ", " ++ showIntListContents(t)
  }
}

export func main() -> () ! {IO} {
  {
    let nums = fromRange(1, 10);
    let evens = filterList(func(n: int) -> bool { (n % 2) == 0 }, nums);
    let squares = mapList(func(n: int) -> int { n * n }, evens);
    let sum = foldList(func(acc: int, n: int) -> int { acc + n }, 0, squares);
    println("Original: " ++ showIntList(nums));
    println("Evens: " ++ showIntList(evens));
    println("Squares: " ++ showIntList(squares));
    println("Sum of squares of evens: " ++ show(sum))
  }
}

