type Tree = Leaf(int) | Node(Tree, int, Tree)

export func tree_sum(tree: Tree) -> int {
  match tree {
    Leaf(v) => v,
    Node(l, v, r) => tree_sum(l) + v + tree_sum(r)
  }
}

export func find_max(tree: Tree) -> int {
  match tree {
    Leaf(v) => v,
    Node(l, v, r) => {
      let left_max = find_max(l);
      let right_max = find_max(r);
      let max_child = if left_max > right_max then left_max else right_max;
      if v > max_child then v else max_child
    }
  }
}

export func main() -> () ! {IO} {
  let sample_tree = Node(Leaf(1), 5, Node(Leaf(3), 7, Leaf(2)));
  let sum = tree_sum(sample_tree);
  let max = find_max(sample_tree);
  println("Sum: " ++ show(sum));
